        <h1 style={{ color: '#295135', marginBottom: '1rem' }}>Approve Booking</h1>
        <p style={{ color: '#86571F' }}>This is a placeholder for the Approve screen. Implement your approval logic here.</p>
      </div>
    </div>
  );
};

